import React from "react";


const mydata={
    "myDeviceData":[
        {
            "name":"iPad Pro",
            "RAM":6,
            "HomeButton":false,
            "TuchID":"NO",
            "FaceID":"YES"
        },{
            "name":"iPone Xs",
            "RAM":4,
            "HomeButton":false,
            "TuchID":"NO",
            "FaceID":"YES"
        },{
            "name":"iPad 6",
            "RAM":2,
            "HomeButton":true,
            "TuchID":"NO",
            "FaceID":"YES"
        },

    ]
};
function Device(data){
    console.log(JSON.stringify(data))
    return <div>{data.mydevice},{data.myfavoritecharacter},{data.mynum}</div>;
}

export default Device;
